webpackJsonp([0xe160165375afa800],{"./node_modules/json-loader/index.js!./.cache/json/javascript-tutorials-finding-a-remainder-in-javascript.json":function(e,n){e.exports={data:{markdownRemark:{html:'<p>The <em>remainder operator</em> <code>%</code> gives the remainder of the division of two numbers.</p>\n<h2>Example</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>5 % 2 = 1 because\nMath.floor(5 / 2) = 2 (Quotient)\n2 * 2 = 4\n5 - 4 = 1 (Remainder)</code></pre>\n      </div>\n<h2>Usage</h2>\n<p>In mathematics, a number can be checked even or odd by checking the remainder of the division of the number by 2.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>17 % 2 = 1 (17 is Odd)\n48 % 2 = 0 (48 is Even)</code></pre>\n      </div>\n<p><strong>Note</strong> Do not confuse it with <em>modulus</em> <code>%</code> does not work well with negative numbers.</p>',fields:{slug:"/javascript/tutorials/finding-a-remainder-in-javascript/"},frontmatter:{title:"Finding a Remainder in JavaScript"}}},pathContext:{slug:"/javascript/tutorials/finding-a-remainder-in-javascript/"}}}});
